import './App.css';
import React  from "react";
import NewSearch from "./components/newSearch/NewSearch"

import {Song, songLoader} from "./data/songs";


function App() {
    //const [currentSong, setCurrentSong] = useState<number>();

    //setCurrentSong(2);
    let songs: () => Song[];
    songs = songLoader();
    return (
        <div className="main">
            <NewSearch/>
            <p>show this</p>
            <p>{songs}</p>
        </div>

    )
};
export default App;
